from itertools import permutations
def solution(cost, x):
    """
        1. 순열로 찾을 수 있는 모든 조합을 구함
        2. cost 조합이 사용할 수 있는 X보다 클 경우 건너뛴다
        3. 사용할 수 있는 X보다 작은 조합들에서 index값들을 구한다
        4. 물감의 개수를 구하여 현재 가장 많다고 저장되어있는 물감의 개수와 비교한다
        => 시간이 오래걸릴 것으로 판단되는 구간은 2번에서 cost조합의 합을 구할 때 sum함수와 loop문이 많다는 것이다.
        !!Test Case 2에서 X == sum(cost)가 max인 상황에서 시간이 너무 오래 걸림
    """
    diivision = 10 ** 9 + 7
    answer = -1
    p = len(cost)
    while p > 0:
        primarity = permutations(cost,p)
        for paint_cost in primarity:
            if sum(paint_cost) > x:
                continue
            #print(paint_cost)
            # print(f"paint_cost: {paint_cost}")
            val_sum = 0
            #find index
            for k in paint_cost:
                val_sum += 2 ** cost.index(k)
            if answer < val_sum:
                answer = val_sum
            elif answer == val_sum:
                break
            if len(cost) == len(paint_cost):
                return answer % diivision
        p -= 1

    return answer % diivision

